      out.write("\t\t\t\n");
      out.write("\t\tif(fmtTime.getTime() - date.getTime()<=0){\n");
      out.write("\t\t\treturn \"00:00:00\";\n");
      out.write("\t\t}\n");
      out.write("\t\t//경과 시간\n");
      out.write("\t\tlet elapsedTime = (fmtTime.getTime() - date.getTime()) / 1000;\n");
      out.write("\t\t\n");
      out.write("\t\tconsole.log(\"==========\"+elapsedTime);\n");
      out.write("\n");
      out.write("\t\t//경과 시간 시분초 구한다\n");
      out.write("\t\tlet elapsedSec = Math.floor((elapsedTime % 3600 % 60));\n");
      out.write("\t\tlet elapsedMin = Math.floor((elapsedTime % 3600 / 60));\n");
      out.write("\t\tlet elapsedHour = Math.floor((elapsedTime / 3600));\n");
      out.write("\t\t\n");
      out.write("\t\tconsole.log(\"hour: \" +elapsedHour);\n");
      out.write("\t\tconsole.log(\"m: \" +elapsedMin);\n");
      out.write("\t\tconsole.log(\"s: \" +elapsedSec);\n");
      out.write("\t\t\n");
      out.write("\t\t//시분초 문자열 00:00:00\n");
      out.write("\t\tlet elapTime = [ (elapsedHour > 9 ? '' : '0')+ elapsedHour, ':',\n");
      out.write("\t\t\t\t\t\t(elapsedMin > 9  ? '' : '0')+ elapsedMin, ':',\n");
      out.write("\t\t\t\t\t\t(elapsedSec > 9  ? '' : '0')+ elapsedSec].join('');\n");
      out.write("\t\t\t\t\t\t\t\t\n");
      out.write("\t\tconsole.log(\"elapTime========\"+elapTime);\n");
      out.write("\t\treturn elapTime;\n");
      out.write("\t}\n");
